import React from "react";
import { useState } from "react";
import { useEffect } from "react";

const ShowQuestions = () => {
  const [data, setData] = useState("");
  const [questionId, setquestionId] = useState("");
  const [questionDetail, setquestionDetail] = useState("");
  const [optionA, setoptionA] = useState("");
  const [optionB, setoptionB] = useState("");
  const [optionC, setoptionC] = useState("");
  const [optionD, setoptionD] = useState("");
  const [optionE, setoptionE] = useState("");
  const [answer, setanswer] = useState("");
  const [numAnswers, setnumAnswers] = useState("");
  const [questionType, setquestionType] = useState("");
  const [difficultyLevel, setdifficultyLevel] = useState("");
  const [answerValue, setanswerValue] = useState("");
  const [topicId, settopicId] = useState("");
  const [negativeMarkValue, setnegativeMarkValue] = useState("");

  // const deleteRows = (index) => {
  //   const updatedRows = [...data];
  //   updatedRows.splice(index, 1);
  //   setData(updatedRows);
  //   // fetch("https://localhost:8443/onlineexam/control/deleteexam", {
  //   //   method: "DELETE",
  //   // });
  // };

  async function fetchInfo() {
    console.log("fetch obj is called....");

    const response = await fetch(
      "https://localhost:8443/onlineexam/control/questionMasterList"
    );

    const text = await response.json();

    setData(text.listOfQuestions);
    //   setquestionId(data.questionId);
    //   setquestionDetail(data.questionDetail);
    console.log(text.listOfQuestions);
    console.log("listOfQuestions..", text.listOfQuestions);
  }

  useEffect(() => {
    fetchInfo();
  }, []);

  return (
    <div className="container">
      <div class="accordion accordion-flush" id="accordionExample">
        {data
          ? data.map((obj, value) => {
              return (
                <div class="accordion-item" id="accordionitem">
                  <h6 class="accordion-header " id="headingOne">
                    <button
                      class="accordion-button collapsed text-primary bg-white w-100"
                      type="button"
                      data-bs-toggle="collapse"
                      data-bs-target={`#collapseOne${value}`}
                      aria-expanded="true"
                      aria-controls="collapseOne"
                    >
                What is meant by HTML?
                      <button className="btn btn-primary offset-10">
                        Edit
                      </button>
                      <button className="btn btn-danger">Delete</button>
                    </button>
                  </h6>
                  <div
                    id={`collapseOne${value}`}
                    class="accordion-collapse collapse"
                    aria-labelledby="headingOne"
                    data-bs-parent="#accordionitem"
                  >
                    <div class="accordion-body justify-content-left">
                      <p key={obj.optionA}>Option A: {obj.optionA}</p>
                      <p key={obj.optionB}>Option B: {obj.optionB}</p>
                      <p key={data.optionC}>Option C: {obj.optionC}</p>
                      <p key={data.optionD}>Option D : {obj.optionD}</p>
                      <p key={data.optionE}>Option E : {obj.optionE}</p>
                    </div>
                  </div>
                  <div
                    id={`collapseOne${value}`}
                    className="accordion-collapse collapse"
                    aria-labelledby="headingOne"
                    data-bs-parent="accordionExample"
                  >
                    <div className="accordion-body">
                      <table className="table table-striped ">
                        <thead>
                          <tr>
                            <th></th>
                            <th>ExamName</th>
                            <th>CreationDate</th>
                            <th>ExpirationDate</th>
                            <th>No of Questions</th>
                            <th>Duration Minutes</th>
                            <th>Pass Percentage</th>
                            <th>Questions Randomized</th>
                            {/* <th>Answers Must</th> */}
                            {/* <th>Enable negative Mark</th> */}
                            <th>Negative Mark value</th>
                          </tr>
                        </thead>

                        <tbody>
                          <tr>
                            <td>{obj.questionId}</td>
                            <td>{obj.numAnswers}</td>
                            <td>{obj.difficultyLevel}</td>
                            <td>{obj.answerValue}</td>
                            <td>{obj.topicId}</td>
                            <td>{obj.negativeMarkValue}</td>
                            {/* <td>
                            <button className="btn btn-primary">Edit</button>
                          </td>
                          <td>
                            <button>className="btn btn-danger" Delete</button>
                          </td> */}
                          </tr>
                        </tbody>
                      </table>
                    </div>
                  </div>
                </div>
              );
            })
          : ""}

        {/* <   div class="accordion-item">
    <h2 class="accordion-header" id="headingTwo">
      <button class="accordion-button collapsed" type="button" data-bs-toggle="collapse" data-bs-target="#collapseTwo" aria-expanded="false" aria-controls="collapseTwo">
        Accordion Item #2
      </button>
    </h2>
    <div id="collapseTwo" class="accordion-collapse collapse" aria-labelledby="headingTwo" data-bs-parent="#accordionExample">
      <div class="accordion-body">
        <strong>This is the second item's accordion body.</strong> It is hidden by default, until the collapse plugin adds the appropriate classes that we use to style each element. These classes control the overall appearance, as well as the showing and hiding via CSS transitions. You can modify any of this with custom CSS or overriding our default variables. It's also worth noting that just about any HTML can go within the <code>.accordion-body</code>, though the transition does limit overflow.
      </div>
    </div>
  </div> */}
      </div>
    </div>
  );
};

export default ShowQuestions;
